//Image storage
const darkDropShadow = 'data:image/png;base64,'
const lightDropShadow = 'data:image/png;base64,'
const qrCover = 'data:image/png;base64,'
const poweredByKodyPayDark = 'data:image/png;base64,'
const poweredByKodyPayLight = 'data:image/png;base64,'

//PDF variable storage
let logoB64 = ""
let bgB64 = ""
let imageHeight = 0
let imageWidth = 0
let aspectRatio = 1.0
let bgAspectRatio = 1.0
let imageYOffset = 0
let qrType = "tables"
let typeYOffset = -3
let accentHEX = "#1566d1"
let accentTwoHex = "#CDD8F0"

//Generate PDF
$('#cmd').click(function () {

    const accentRGB = hexToRgb(accentHEX)
    const accentTwoRGB = hexToRgb(accentTwoHex)
    const isDarkMode = $("#darkMode").prop("checked")
    const firstTable = tables[0] ?? ""
    const tablesToInsert = tables.slice(1)
    const batchCode = $("#batchCode").val()

    if (qrType === "counter-only" && logoB64 === "") {
        typeYOffset = -8
    }
    else if (qrType === "tables" && logoB64 === "" && tablesToInsert.length === 0) {
        typeYOffset = -8
    }
    const doc = new jsPDF("p", "mm", "a6")

    //Global font
    doc.addFileToVFS('KodyPay-Regular.ttf', eval($("#font").val() + "Regular"));
    doc.addFileToVFS('KodyPay-Bold.ttf', eval($("#font").val() + "Bold"));
    doc.addFont('KodyPay-Regular.ttf', 'KodyPay', 'normal');
    doc.addFont('KodyPay-Bold.ttf', 'KodyPay', 'bold');
    doc.setFont('KodyPay');

    //First table
    styleFrontSide(firstTable)
    addRearSide(firstTable)

    //Remaining tables
    tablesToInsert.forEach(function(element){
        doc.addPage("a6")
        styleFrontSide(element)
        addRearSide(element)
    });

    function styleFrontSide(element) {
        //Background
        doc.setFillColor(isDarkMode ? 38 : 255, isDarkMode ? 36 : 255, isDarkMode ? 37 : 255);
        doc.rect(0, 0, 105, 148, "F");
        if (bgB64 !== "") {
            doc.addImage(bgB64, "PNG", 0, 0, 148 * bgAspectRatio, 148)
        }

        //Accent colour circle
        doc.setFillColor(accentRGB[0], accentRGB[1], accentRGB[2]);
        doc.circle(52.5, 66 + typeYOffset, 40, "F")

        //Rounded rectangle
        doc.addImage(isDarkMode ? darkDropShadow : lightDropShadow, "PNG", 12.5, 28 + typeYOffset, 80, 80);
        doc.setFillColor(255, 255, 255);
        doc.roundedRect(20, 34 + typeYOffset, 65, 65, 4, 4, "F")

        //Table number
        if (qrType !== "select-table") {
            doc.setTextColor(isDarkMode ? 255 : 21, isDarkMode ? 255 : 21, isDarkMode ? 255 : 21);
            doc.setFontSize(40);
            doc.setFontStyle("bold");
            doc.text(element, 15, 21, {align: 'center', charSpace: "0"});
        }

        //Pen-on table number
        else {
            //Accent colour circle
            doc.setFillColor(accentTwoRGB[0], accentTwoRGB[1], accentTwoRGB[2]);
            doc.circle(15, 15, 10, "F")

            //Subtitle
            doc.setTextColor(62, 62, 62);
            doc.setFontSize(9);
            doc.setFontStyle("bold");
            doc.text("TABLE", 14, 11, {align: "center", charSpace: "0.5"});
        }

        //Title
        doc.setFontSize(28);
        doc.setFontStyle("bold");
        doc.text($("#font").val() === "oswald" ? "SCAN, ORDER & PAY" : "Scan, Order & Pay", 52.5, 120 + typeYOffset, {align: 'center', charSpace: "0"});

        if ($("#hasBack").prop("checked")) {
            //Subtitle
            doc.setTextColor(isDarkMode ? 245 : 62, isDarkMode ? 245 : 62, isDarkMode ? 245 : 62);
            doc.setFontSize(10);
            doc.setFontStyle("bold");
            doc.text("SEE BACK FOR DETAILS", 49, 129 + typeYOffset, {align: "center", charSpace: "0.5"});
        }

        //Powered by KodyPay logo
        doc.addImage(isDarkMode ? poweredByKodyPayDark : poweredByKodyPayLight, 'PNG', 34.5, 139, 36, 4);

        //QR code
        doc.addImage(generateQRCodePNG(element, batchCode), 'PNG', 22.5, 36.5 + typeYOffset, 60, 60);
        doc.addImage(qrCover, 'PNG', 22.5, 36.5 + typeYOffset, 60, 60)

        //Company logo
        if (logoB64 !== "") {
            doc.addImage(logoB64, "PNG", 100 - imageWidth, imageYOffset + 22 - imageHeight, imageWidth, imageHeight)
        }
    }

    //Rear side
    function addRearSide(element) {
        if ($("#hasBack").prop("checked")) {
            doc.addPage("a6")

            //Background
            doc.setFillColor(isDarkMode ? 38 : 255, isDarkMode ? 36 : 255, isDarkMode ? 37 : 255);
            doc.rect(0, 0, 105, 148, "F");
            if (bgB64 !== "") {
                doc.addImage(bgB64, "PNG", 0, 0, 148 * bgAspectRatio, 148)
            }

            //Accent colour circle
            doc.setFillColor(accentRGB[0], accentRGB[1], accentRGB[2]);
            doc.circle(52.5, 59.5 + typeYOffset, 35, "F")

            //Rounded rectangle
            doc.addImage(isDarkMode ? darkDropShadow : lightDropShadow, "PNG", 18, 25 + typeYOffset, 70, 70);
            doc.setFillColor(255, 255, 255);
            doc.roundedRect(23.5, 30.5 + typeYOffset, 58, 58, 4, 4, "F")

            //Table number
            if (qrType !== "select-table") {
                doc.setTextColor(isDarkMode ? 255 : 21, isDarkMode ? 255 : 21, isDarkMode ? 255 : 21);
                doc.setFontSize(40);
                doc.setFontStyle("bold");
                doc.text(element, 15, 21, {align: 'center', charSpace: "0"});
            }

            //Pen-on table number
            else {
                //Accent colour circle
                doc.setFillColor(accentTwoRGB[0], accentTwoRGB[1], accentTwoRGB[2]);
                doc.circle(15, 15, 10, "F")

                //Subtitle
                doc.setTextColor(62, 62, 62);
                doc.setFontSize(9);
                doc.setFontStyle("bold");
                doc.text("TABLE", 14, 11, {align: "center", charSpace: "0.5"});
            }

            //Powered by KodyPay logo
            doc.addImage(isDarkMode ? poweredByKodyPayDark : poweredByKodyPayLight, 'PNG', 34.5, 139, 36, 4);

            //QR code
            doc.addImage(generateQRCodePNG(element, batchCode), 'PNG', 26, 34 + typeYOffset, 52, 52);
            doc.addImage(qrCover, 'PNG', 26, 34 + typeYOffset, 52, 52)

            //Company logo
            if (logoB64 !== "") {
                doc.addImage(logoB64, "PNG", 100 - imageWidth, imageYOffset + 22 - imageHeight, imageWidth, imageHeight)
            }

            //Bullet point
            function addBullet(yOffset, number) {
                //Accent colour circle
                doc.setFillColor(accentRGB[0], accentRGB[1], accentRGB[2]);
                doc.circle(20.5, yOffset + typeYOffset, 3.5, "F")

                //Bullet number
                doc.setTextColor(255, 255, 255);
                doc.setFontSize(12);
                doc.setFontStyle("bold");
                doc.text(number, 20.5, yOffset + 1.2 + typeYOffset, {align: 'center', charSpace: "0"});
            }

            function addBulletText(yOffset, text) {
                //Text
                doc.setTextColor(isDarkMode ? 245 : 62, isDarkMode ? 245 : 62, isDarkMode ? 245 : 62);
                doc.setFontSize(14);
                doc.setFontStyle("normal");
                doc.text(text, 26, yOffset + typeYOffset);
            }

            switch(qrType) {
                case "tables":
                    addBullet(102, "1")
                    addBulletText(103.5, "Scan the QR code")
                    addBullet(112, "2")
                    addBulletText(113.5, "Choose your order & pay")
                    addBullet(122, "3")
                    addBulletText(123.5, "Your order will be delivered\nto your table")
                    break;
                case "select-table":
                    addBullet(102, "1")
                    addBulletText(103.5, "Scan the QR code")
                    addBullet(112, "2")
                    addBulletText(113.5, "Select your table,\nchoose your order & pay")
                    addBullet(126, "3")
                    addBulletText(127.5, "Your order will be delivered\nto your table")
                    break;
                default:
                    addBullet(102, "1")
                    addBulletText(103.5, "Scan the QR code")
                    addBullet(112, "2")
                    addBulletText(113.5, "Choose your order & pay")
                    addBullet(122, "3")
                    addBulletText(123.5, "Collect your order at the\ncounter")
            }

        }
    }

    doc.save("kodypay-stand-a6.pdf");
});
